import React, { Suspense } from "react";
import { Canvas } from "@react-three/fiber";
import { Scene } from "./Scene";

import "./App.scss";

const App = () => {
  return (
    <>
      <Canvas>
        <ambientLight />
        <directionalLight color="red" intensity={10} />
        <Suspense fallback={null}>
          <Scene />
        </Suspense>
      </Canvas>
    </>
  );
};

export default App;
